import React from "react";
import { Person } from "../types/personType";

interface Props {
  people: Person[];
}

const List: React.FC<Props> = ({ people }) => {

    const listPerson = () => {
        return people.map(person => {
            <li className="list">
                <div className="list-header">
                    <img src={person.url} alt="person image" />
                    <h2>{person.name}</h2>
                </div>
                <p>{person.age} years old</p>
                <p>{person.note}</p>
            </li>
        })
    }


  return (
    <div>
      {people.map((person) => {
        return (
          <div className="card">
            {person.url} - {person.name}
          </div>
        );
      })}
    </div>
  );
};

export default List;
